  height: 1000px;
  width: 1000px;
  overflow: hidden;
  background: blue;
  position: relative;
  border: 10px solid green;
`;

const Wrapper = styled.div`
  height: 550px;
  width: 300px;

  overflow: visible;
  background: white;
  border: 10px solid red;
`;

const Map = styled.div`
  width: 500px;
  height: 500px;
  background-color: blue;
`;

const WrapperBack = () => {
  return (
    // <Container>
    <Wrapper>
    <TransformWrapper
      defaultScale={0.1}
      defaultPositionX={0}
      defaultPositionY={0}
      minScale={0.2}
      maxScale={5}
    >
      {({ zoomIn, zoomOut, resetTransform, positionX, positionY, ...rest }) => (
        <React.Fragment>
          <TransformComponent>
            <Container>
            </Container>
          </TransformComponent>
        </React.Fragment>
      )}
    </TransformWrapper>
    {/* </Container> */}
    </Wrapper>
  );
};

export default WrapperBack;

